function setDefaultPose() {
  lookingDownThreshold = lookingStraight - lookingStraightTolerance;
  lookingUpThreshold = lookingStraight + lookingStraightTolerance;
  headSizeThreshold = headSize + headSizeTolerance;
  leftRightThreshold = leftRight + leftRightTolerance;
  noseYThreshold = noseY + noseYTolerance;
  defaultHeadSize = headSize;
  defaultNoseY = noseY;
  console.log("Setting default pose", lookingStraight, headSize, leftRight, noseY);
}

function calculateScore() {
  console.log("headSize:", headSize, "default:", defaultHeadSize);
  let headSizeScore = (headSize - defaultHeadSize) * zScoreMultiplier;
  if (headSizeScore < 0) {
    headSizeScore = 0;
  }
  console.log("noseY:", noseY, "default:", defaultNoseY);
  let noseYScore = (noseY - defaultNoseY) * yScoreMultiplier;
  if (noseYScore < 0) {
    noseYScore = 0;
  }
  let score = 100 - headSizeScore - noseYScore;
  console.log(score, headSizeScore, noseYScore);
  if (score < 0) {
    return 0;
  } else if (score >= 100) {
    return 100;
  }
  return (Math.floor(score / 5) + 1) * 5; // round score up to the nearest 5
}

/**
 * Loads a the camera to be used in the demo
 *
 */
async function setupCamera() {
  if (!navigator.mediaDevices || !navigator.mediaDevices.getUserMedia) {
    throw new Error(
      'Browser API navigator.mediaDevices.getUserMedia not available');
  }

  const video = document.getElementById('video');
  video.width = videoWidth;
  video.height = videoHeight;

  const mobile = isMobile();
  const stream = await navigator.mediaDevices.getUserMedia({
    'audio': false,
    'video': {
      facingMode: 'user',
      width: mobile ? undefined : videoWidth,
      height: mobile ? undefined : videoHeight,
    },
  });
  video.srcObject = stream;

  return new Promise((resolve) => {
    video.onloadedmetadata = () => {
      resolve(video);
    };
  });
}

async function loadVideo() {
  const video = await setupCamera();
  video.play();

  return video;
}

